import React from "react";
import "../index.css";
import Logo from "./images/navbtn.png";
import banner1 from "./images/banner1.png";
import banner2 from "./images/banner2.png";
import banner3 from "./images/banner3.png";
import banner4 from "./images/banner4.png";
import banner5 from "./images/banner5.png";
import { NavLink } from "react-router-dom";

function Header() {

  return (<>
   
    <ul className="navbar-nav mb-2 mb-sm-0 ms-auto header" id="mySidenav">
      
    <li className="nav-item mx-4"  id="a">
      <NavLink className="nav-link active py-0" id="about"  to="/signin"><img src={banner5} className="rounded-5" /><span className="text">Signup</span></NavLink>
    </li>
    <li className="nav-item mx-4" id="b">
      <NavLink className="nav-link py-0" id="blog" to="/courses"><img src={banner4} className="rounded-5"/><span className="text">Courses</span></NavLink>
    </li>
    <li className="nav-item mx-4" id="c">
      <NavLink className="nav-link py-0" id="projects" to="/contect"><img src={banner3}  className="rounded-5" /><span className="text">Contect</span></NavLink>
    </li>
    <li className="nav-item mx-4" id="d">
      <NavLink className="nav-link py-0" id="contact" to="/about"><img src={banner2}  className="rounded-5" /><span className="text">About</span></NavLink>
    </li>
    <li className="nav-item mx-4" id="e">
      <NavLink className="nav-link py-0" id="login" to="/"><img src={banner1}  className="rounded-5" /><span className="text">Home</span></NavLink>
    </li>
  </ul>
  <div className="navbar-brand"> Navbar</div>




  mysmallnav






  </> );
}


export default Header;
